import React from "react";
import { Navbar } from "react-bootstrap";

const ApprovalHeader = () => {
  return (
    <>
      <Navbar expand="lg" bg="light">
        <Navbar.Text>
          &nbsp; <strong>Dashboard : Manage Approvals</strong>
        </Navbar.Text>
      </Navbar>
      <br />
    </>
  );
};

export default ApprovalHeader;
